15" Diamondhead VRS T Free-Float Handguard. Diamondhead USA's innovative VRS T Free-Floating Handguard HandguardÂ System features an uninterrupted rail extension / handguard in perfect alignment with the host weapon's flat top receiver. Simply attach rails and bumpers to the VRS for all rail-mounted accessories.Features:

Designed to give a factory installed appearence to the weapon;
Requires removal of both delta ring and factory barrel nut and replacement of front sight with low profile gas block
Propriety replacement barrel nut included with rail that allows for easy installation and elimination of barrel nut timing issues;
Mounts on barrels with low profile gas block, or can replace fixed front sight (using basic punch & hammer) with a low-profile gas block (not included);
Comfortable rounded triangular shape
